import React,{useState, useEffect} from 'react';

const Home = function(){
    const [posts, setPosts] = useState("");
    fetch('http://localhost:3000/posts')
    .then((response) =>{
        response.json().then((result) =>{            
            posts.push(result);
            console.log(posts);
        })
    });
    return <>
        <h1>Blogs</h1>
        {
            posts.map((item) =>{
               return console.log('title ' + item.title);
            })
        }
    </>
}

export default Home
